const Minio = require("minio");
const { Readable } = require("stream");
const { v4: uuidv4 } = require("uuid");
const { getExtensionFromBase64 } = require("./teste");

// Carregar variáveis de ambiente do arquivo .env
require("dotenv").config();

// Configuração do cliente MinIO usando variáveis de ambiente
const minioClient = new Minio.Client({
  endPoint: process.env.MINIO_ENDPOINT, // Carregado do .env
  port: parseInt(process.env.MINIO_PORT, 10), // Carregado do .env e convertido para número
  useSSL: process.env.MINIO_USE_SSL === "true", // Carregado do .env como booleano
  accessKey: process.env.MINIO_ACCESS_KEY, // Carregado do .env
  secretKey: process.env.MINIO_SECRET_KEY, // Carregado do .env
});

// Função para converter Base64 para stream
function bufferToStream(buffer) {
  const stream = new Readable();
  stream.push(buffer);
  stream.push(null); // indica o fim do stream
  return stream;
}

// Exemplo de string Base64
const base64String =
  "";

// Remover cabeçalho da Base64, se presente
const base64Data = base64String.replace(/^data\:.*\/.*\;base64\,/, "");

// Converter Base64 para Buffer
const buffer = Buffer.from(base64Data, "base64");

const extensao = getExtensionFromBase64(base64String) ?? "pdf";

// Criar um stream a partir do buffer
const stream = bufferToStream(buffer);

// Upload do arquivo para o bucket no MinIO
const bucketName = process.env.MINIO_BUCKET_NAME; // Carregado do .env
const objectName = `teste/${uuidv4()}.${extensao}`;
const size = buffer.length;

minioClient.putObject(
  bucketName,
  objectName,
  stream,
  size,
  function (err, etag) {
    if (err) {
      return console.log("Error uploading file:", err);
    }
    console.log("File uploaded successfully. ETag:", etag);
  }
);
